import React from 'react';


function Todo(){

    function add(event){
        var name=event.target.value
    }
    return (
    <>
    <h1>Todo List</h1>
    <h2>{name}</h2>
    <input type="text" value="" className="input" onChange={add}/>
    </>
    );
}


export default Todo;
